function createRowHandlers (tableName) {
	var subjectTable = document.getElementById(tableName);
	var rowsArray = subjectTable.getElementsByTagName("tr");

	for (i = 0; i < rowsArray.length; i++) {
		var currentRow = rowsArray[i];
		if (currentRow.parentElement.nodeName === "THEAD") {
			continue;
		}

		if (tableName === "subject-table") {
			currentRow.onclick = subjectHandlerHelper(currentRow);
		}
		else if (tableName === "course-table") {
			currentRow.onclick = courseHandlerHelper(currentRow);
		}
	}
}

function subjectHandlerHelper(row) {
	return function() {
		var subjectSelected = row.getElementsByTagName("td")[0].innerHTML;
		window.location.href = "subject.html?code=" + subjectSelected;
	}
}

function courseHandlerHelper(row) {
	return function() {
		var courseNameArray = row.getElementsByTagName("td")[0].innerHTML.split(" ");
		// var courseTitle = row.getElementsByTagName("td")[1].innerHTML;

		window.location.href = "class.html?code=" + courseNameArray[0] + "&number=" + courseNameArray[1];
	}
}

function loadCourses() {
	var subject = window.location.search.substring(1).split("=")[1];
	var courseTable = document.getElementById("course-table-body");

	for (i = 0; i < subjectList.length; i++) {
		if (subjectList[i].Code == subject) {
			var subjectPageHeader = document.getElementById("subject-header");
			subjectPageHeader.innerHTML = subjectList[i].Subject;
			break;
		}
	}

	for (i = 0; i < courseList.length; i++) {
		if (courseList[i].Code === subject) {
			var newCourseRow = courseTable.insertRow();
			var newCourseNumberCell = newCourseRow.insertCell(0);
			var newCourseTitleCell = newCourseRow.insertCell(1);

			newCourseNumberCell.innerHTML = courseList[i].Code + " " + courseList[i].Number;
			newCourseTitleCell.innerHTML = courseList[i].Title;
		}
	}

	createRowHandlers("course-table");
}

function loadSections() {
	var queryStringArray = window.location.search.split("=");
	var courseCode = queryStringArray[1].split("&")[0];
	var courseNumber = queryStringArray[2];

	var courseNameHeader = document.getElementById("subject-header");
	
	for (i = 0; i < courseList.length; i++) {
		if ((courseList[i].Code + courseList[i].Number) === (courseCode + courseNumber)) {
			courseNameHeader.innerHTML = courseCode + " " + courseNumber + ": " + courseList[i].Title;
			break;
		}
	}

	var sectionTable = document.getElementById("section-table-body");

	for (i = 0; i < sectionList.length; i++) {
		if ((sectionList[i].Code + sectionList[i].Number) === (courseCode + courseNumber)) {
			var newSectionRow = sectionTable.insertRow();

			newSectionRow.insertCell(0).innerHTML = sectionList[i].Section;
			newSectionRow.insertCell(1).innerHTML = sectionList[i].Credit;
			newSectionRow.insertCell(2).innerHTML = sectionList[i].Instructor;
			newSectionRow.insertCell(3).innerHTML = sectionList[i].Day;
			newSectionRow.insertCell(4).innerHTML = sectionList[i].Time;
			newSectionRow.insertCell(5).innerHTML = sectionList[i].Actual;
			newSectionRow.insertCell(6).innerHTML = sectionList[i].Capacity;
			newSectionRow.insertCell(7).innerHTML = sectionList[i].Location;
			newSectionRow.insertCell(8).innerHTML = sectionList[i].CRN;
			// newSectionRow.insertCell(9).innerHTML = sectionList[i].Attr;
		}
	}

}

